import React from "react";

function HomePage() {
  const styles = {
    width: "100px",
    fontSize: "20px",
    borderRadius: "40px",
    border: "1px solid black",
    color: "#fafafa",
    margin: "0.5em 1em",
    padding: "0.25em 1em",
    background: "#c83f49",
  };

  return (
    <div className="App">
      <button  style={styles}>
        {" "}
        Red
      </button>
    </div>
  );
}

export default HomePage;
